import s from "../Button/Button.module.css";
import React from "react";

type ButtonPropsType = {
    nameButton:string
    buttonClick:()=>void
    value:number
    buttonInc:()=>void
}
export const Button = (props: ButtonPropsType) => {
    let presentValue = props.value
    const incButton = () => presentValue < 5 ? props.buttonInc() : ''
    return <div className={s.button}>
        <button onClick={incButton} disabled={presentValue === 5}>{props.nameButton}</button>
    </div>
}
